            50,
            50
        ],
        "avatar": "https://res.cloudinary.com/getapet/image/upload/v1618040873/shelter_img/logo_1_su3vfc.jpg",
        "image": [],
        "name": "Defensa Felina",
        "email": "mhemstead0@geocities.com",
