        "phone": "664549474",
        "contact": "Martica Hemstead",
        "cif": "A34149454",
        "rol": "shelter",
    }
 * 
 */

function ShelterForm() {

    const [state, setState] = useState({
        name: ''
    });



    const handleSubmit = (event) => {
        event.preventDefault();
    }

    return (
        <div className="container">
            <form onSubmit={handleSubmit}>
                <div className="input-group mb-4">
                    <span><i className="fas fa-user" size='2x'></i></span>
                    <input id="exampleFormControlInput2" type="email" placeholder="Name of your shelter" className="form-control form-control-underlined border-primary"/>
                </div>
            </form>
        </div>
        
    );


}

export default ShelterForm;
